============================================
Description:                               =
============================================

Be your own teammates in this unique single-player co-op
shooter!

You have 4 lives, destroy as many enemies as possible
With each new life you'll be joined by ghosts of your
previous lives

The Let's Replay mode lets you play with other people's
ghosts that have been uploaded to the Steam Workshop

